import { Modal, ModalProps } from "react-native";
import styled from "styled-components/native";
import Ionicons from "@expo/vector-icons/Ionicons";

interface Props extends ModalProps {}

const ClientLoginModal = ({ children, ...others }: Props) => {
  return (
    <Modal {...others}>
      <FullView>
        <ModalView>
          <InputView>
            <Ionicons name="person-outline" color="white" size={26} />
            <InputField placeholder="Seu nome completo" />
          </InputView>
        </ModalView>
      </FullView>
    </Modal>
  );
};

const InputView = styled.View`
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;
  column-gap: 15px;
`;

const InputField = styled.TextInput`
  background: white;
  padding: 0 20px;
  font-size: 16px;
  border-radius: 5px;
`;
const FullView = styled.View`
  flex: 1;
  justify-content: center;
  align-items: center;
`;
const ModalView = styled.View`
  display: flex;
  justify-content: center;
  background: rgba(0, 0, 0, 0.5);
  border-radius: 20px;
  padding: 35px;
  align-items: center;
`;

export default ClientLoginModal;
